import React from 'react';
import { Link } from 'react-router-dom';

const Edit = (props) => {
  const resourceId = props.match.params.id;

  return (
    <div>
      <h1 className="text-center">Edit Words</h1>
      <Link to={`resources/${resourceId}/edit/words`}>
        Back to Resources
      </Link>
    </div>
  )
}

export default Edit;
